additionalProperties: false
type: object
properties:
  origin_season_ticket_id:
    type: integer
    format: int64
  origin_season_ticket_name:
    type: string
  renewal_import_date:
    type: string
    format: date-time
  mapped_imports:
    type: integer
  not_mapped_imports:
    type: integer
  total_imports:
    type: integer
  generation_status:
    type: string
    enum:
      - NOT_INITIATED
      - IN_PROGRESS
      - DONE
      - PURGE_IN_PROGRESS
  automatic_renewal_status:
    type: string
    enum:
      - NOT_INITIATED
      - IN_PROGRESS
      - DONE
      - ERROR